    }
    function RegisterClick() {
        setComponent(<Register />);
    }
    return (
        <div className="container-fluid mt-3">
            <button onClick={LoginClick}>Login</button>
            <button onClick={RegisterClick}S>Register</button>
            <hr />
            {component}
        </div>
    );
}




